const container = $(".adoption");
const select = $(".filter select");

select.on("change",()=>{
    renderList();
    // console.log(1)
})

const renderList = () =>{
    container.html("");
    const value=select.val();
    systems.forEach((items)=>{
        if(value === items.type || value ==='all'){
            const card = $("<div> <div>");
            card.addClass("system-card");

             const content = $("<div><div>");
             content.addClass("text-all");

            const name = $("<p> <p>");
            name.text(items.projectName);

            const img = $("<img/>");
            img.attr("src",items.img);

            const descr=$("<p>  <p>");
            descr.text(items.Desc);

            const cap = $("<p>  <p>");
            cap.text(items.capacity)

            card.append(img);
            content.append(name);
            content.append(descr);
            content.append(cap)
            card.append(content);
            container.append(card);
        }
    });
};